26	graduation	4949a789985580faf5b44f2408f9d959e669caf5	Graduation		f	t			updated	4	<figure class="image image_resized" style="width:27.04%;"><img src="/graduation.jpg">\n  <figcaption>https://youtu.be/LYa5q2AjWNQ?si=CU073YWSm3lB7lDV</figcaption>\n</figure>\n<p><span class="text-big" style="font-family:Georgia, serif;"><strong>Graduation (2007)</strong></span></p>\n<p><span style="font-family:Georgia, serif;">Album ten stanowi odejcie od brzmie soulowych na rzecz syntezatorw i estetyki futurystycznej. West zacz samplowa artystw spoza krgu hip-hopu i R&amp;B, czerpic inspiracj z europejskiej elektroniki, rocka stadionowego oraz japoskiego popu. Sample zostay zintegrowane z szerokimi brzmieniami elektronicznymi. Ye postawi na layering dwikw cyfrowych i efektw typu vocoder. Gwne rda to French House, indie rock oraz pop lat 80.</span></p>\n<ol>\n  <li><a href="https://youtu.be/6CHs4x2uqcQ?si=-VNlrKB4M2u2kIeM"><span style="font-family:Georgia, serif;"><strong>Good Morning</strong></span></a>\n    <ul>\n      <li><span style="font-family:Georgia, serif;">"</span><a href="https://youtu.be/A-2vN3YJ29k?si=Mf9fkNl8EFCg87O1"><span style="font-family:Georgia, serif;">Someone Saved My Life Tonight</span></a><span style="font-family:Georgia, serif;">" - Elton John</span></li>\n    </ul>\n  </li>\n  <li><a href="https://youtu.be/jKT4ArZCkso?si=roYBig2wzjV3uuVq"><span style="font-family:Georgia, serif;"><strong>Champion</strong></span></a>\n    <ul>\n      <li><span style="font-family:Georgia, serif;">"</span><a href="https://youtu.be/b00h8iKaklQ?si=y0pLSOCsZUnOLcth"><span style="font-family:Georgia, serif;">Kid Charlemagne</span></a><span style="font-family:Georgia, serif;">" - Steely Dan</span></li>\n    </ul>\n  </li>\n  <li><a href="https://youtu.be/PsO6ZnUZI0g?si=VQ3gtcN5T8mVweBP"><span style="font-family:Georgia, serif;"><strong>Stronger</strong></span></a>\n    <ul>\n      <li><span style="font-family:Georgia, serif;">"</span><a href="https://youtu.be/gAjR4_CbPpQ?si=zH0Vexsd6