46	home	8640a4225bec87504e88716dd75b7c94a3f5ead6	0. Wstp		f	t			updated	1	<p style="text-align:center;"><span class="text-small" style="font-family:'Times New Roman', Times, serif;">Projekt docker [Systemy operacyjne] Katarzyna Pitek, nr albumu 130282</span></p>\n<p style="text-align:center;"><span class="text-big" style="font-family:'Times New Roman', Times, serif;">Witryna ta koncentruje si wycznie na analizie sampli z oficjalnych albumw studyjnych artysty, pomijajc jego bogat dyskografi projektw niewydanych.</span></p>\n<p><span class="text-big" style="font-family:'Times New Roman', Times, serif;"><strong>Kanye Omari West</strong>  amerykaski raper, artysta, wokalista, producent muzyczny, projektant mody oraz kandydat na prezydenta Stanw Zjednoczonych w 2020 roku. Styl muzyczny rapera opiera si przede wszystkim na samplingu, w ktrym artysta rekonstruuje fragmenty R&amp;B lat 70., barokowego popu, trip hopu, rocka stadionowego, folku, synthpopu, a take muzyki alternatywnej, elektronicznej i klasycznej.</span></p>\n<figure class="image image_resized" style="width:65.69%;"><img src="/kanyemisiak.jpg"></figure>\n	html	2026-01-18T21:08:49.001Z	ckeditor	pl	1	2026-01-18T18:04:19.991Z	{}
47	late-registration	f02cc4674647d886707cb41c419ac6772cbe150b	2. Late Registration		f	t			updated	3	<figure class="image image_resized" style="width:27.02%;"><img src="/lateregistration.jpg"></figure>\n<p><span class="text-big" style="font-family:Georgia, serif;"><strong>Late Registration (2005)</strong></span></p>\n<p><span style="font-family:Georgia, serif;">Kanye West rozwin swj warsztat, czc sampling z yw orkiestracj. Przy wsppracy z Jonem Brionem, artysta wzbogaci fragmenty winyli o brzmienie smyczkw, rogw i instrumentw klawiszowych. Odszed od czystego chipmunk soul na rzecz bardziej zoonych aranacji. Sample nie stanowi ju caej struktury utworu, lecz przeplataj si z instrumentami nagranymi na ywo w studio. Poza soul na pycie pojawiaj si sample z jazzu, muzyki filmowej oraz rocka.</span></p>\n<ol>\n  <li><a href="https://youtu.be/Bwyu-SZ7g_E?si=Vy4sKWZ5aRF3sc4D"><span style="font-family:Georgia, serif;"><strong>Wake Up Mr. West</strong></span></a>\n    <ul>\n      <li><span style="font-family:Georgia, serif;">"</span><a href="https://youtu.be/lnr__ZuMk8U?si=M5ajI-5LcsDez9on"><span style="font-family:Georgia, serif;">Someone That I Used to Love</span></a><span style="font-family:Georgia, serif;">" - Natalie Cole</span></li>\n    </ul>\n  </li>\n  <li><a href="https://youtu.be/elVF7oG0pQs?si=RX1jXQkmgSxlABCc"><span style="font-family:Georgia, serif;"><strong>Heard'Em Say</strong></span></a>\n    <ul>\n      <li><span style="font-family:Georgia, serif;">"</span><a href="https://youtu.be/lnr__ZuMk8U?si=M5ajI-5LcsDez9on"><span style="font-family:Georgia, serif;">Someone That I Used to Love</span></a><span style="font-family:Georgia, serif;">" - Natalie Cole</span></li>\n    </ul>\n  </li>\n  <li><a href="https://youtu.be/YkwQbuAGLj4?si=W-y9ZMRLUhty9wy9"><span style="font-family:Georgia, serif;"><strong>Touch The Sky</strong></span></a>\n    <ul>\n      <li><span style="font-family:Georgia, serif;">"</span><a href="https://youtu.be/A9RMr9KuVZo?si=27mMS60txU7nlKvQ"><sp