i><span style="font-family:Georgia, serif;">"Snow Job" - Bruce Haack</span></li>\n    </ul>\n  </li>\n  <li><span style="font-family:Georgia, serif;"><strong>God Is</strong></span>\n    <ul>\n      <li><span style="font-family:Georgia, serif;">"God Is" - James Cleveland, the Southern California Community Choir</span></li>\n    </ul>\n  </li>\n  <li><span style="font-family:Georgia, serif;">Hands On</span></li>\n  <li><span style="font-family:Georgia, serif;"><strong>Use This Gospel</strong></span>\n    <ul>\n      <li><span style="font-family:Georgia, serif;">"Costume Party" - Two Door Cinema Club</span></li>\n    </ul>\n  </li>\n  <li><span style="font-family:Georgia, serif;"><strong>Jesus Is Lord</strong></span>\n    <ul>\n      <li><span style="font-family:Georgia, serif;">"Un Homme Dans La Nuit" - Claude Lveille</span></li>\n    </ul>\n  </li>\n</ol>\n	html	2026-01-18T22:36:57.466Z	ckeditor	pl	1	2026-01-18T21:47:00.690Z	{}
