1	home	8640a4225bec87504e88716dd75b7c94a3f5ead6	00. Wstep		f	t	\N			<p style="text-align:center;"><span class="text-small" style="font-family:'Times New Roman', Times, serif;">Projekt docker [Systemy operacyjne] Katarzyna Piatek, nr albumu 130282</span></p>\n<p style="text-align:center;"><span class="text-big" style="font-family:Georgia, serif;">Witryna ta koncentruje sie wylacznie na analizie sampli z oficjalnych albumow studyjnych artysty do 2019r., pomijajac jego bogata dyskografie projektow niewydanych.</span></p>\n<p><span class="text-big" style="font-family:Georgia, serif;">Kanye Omari West  amerykanski raper, artysta, wokalista, producent muzyczny, projektant mody oraz kandydat na prezydenta Stanow Zjednoczonych w 2020 roku. Styl muzyczny rapera opiera sie przede wszystkim na samplingu, w ktorym artysta rekonstruuje fragmenty R&amp;B lat 70., barokowego popu, trip hopu, rocka stadionowego, folku, synthpopu, a takze muzyki alternatywnej, elektronicznej i klasycznej.</span></p>\n<figure class="image image_resized" style="width:65.69%;"><img src="/kanyemisiak.jpg"></figure>\n	<p style="text-align:center;"><span class="text-small" style="font-family:'Times New Roman', Times, serif;">Projekt docker [Systemy operacyjne] Katarzyna Piatek, nr albumu 130282</span></p>\n<p style="text-align:center;"><span class="text-big" style="font-family:Georgia, serif;">Witryna ta koncentruje sie wylacznie na analizie sampli z oficjalnych albumow studyjnych artysty do 2019r., pomijajac jego bogata dyskografie projektow niewydanych.</span></p>\n<p><span class="text-big" style="font-family:Georgia, serif;">Kanye Omari West  amerykanski raper, artysta, wokalista, producent muzyczny, projektant mody oraz kandydat na prezydenta Stanow Zjednoczonych w 2020 roku. Styl muzyczny rapera opiera sie przede wszystkim na samplingu, w ktorym artysta rekonstruuje fragmenty R&amp;B lat 70., barokowego popu, trip hopu, rocka stadionowego, folku, synthpopu, a takze muzyki alternatywnej, elektronicznej i klasycznej.</span></p>\n<figure class="image image_resized" style="width:65.69%;"><img src="/kanyemisiak.jpg"></figure>\n	[]	html	2026-01-12T20:59:28.834Z	2026-01-27T00:52:52.431Z	ckeditor	pl	1	1	{"js":"","css":""}
2	the-college-dropout	c0354a2f001e06c4c34370756d895b3fde21cd0d	01. The College Dropout		f	t	\N			<figure class="image image_resized" style="width:30%;"><img src="/thecollegedropout.jpg"></figure>\n<p><span class="text-big" style="font-family:Georgia, serif;"><strong>The College Dropout (2004)</strong></span></p>\n<p>Fundamentem albumu jest technika chipmunk soul, polegajaca na drastycznym przyspieszeniu fragmentow plyt soulowych, co skutkuje nienaturalnie wysoka barwa wokalu przy jednoczesnym zachowaniu pierwotnego rytmu. West wykorzystal sampler Ensoniq ASR-10 do choppingu melodii. Album bazuje glownie na katalogu wytworni Motown oraz klasykach soulu i R&amp;B z lat 70.</p>\n<ol>\n  <li><span style="font-family:Georgia, serif;">Intro</span></li>\n  <li><a href="https://youtu.be/0Tdpq3FRGhY?si=1UwpgG9w552lN5RY"><span style="font-family:Georgia, serif;"><strong>We Don't Care</strong></span></a><span style="font-family:Georgia, serif;"><strong>&nbsp; </strong>&nbsp;</span>\n    <ul>\n      <li><span style="font-family:Georgia, serif;">"</span><a href="https://youtu.be/xf9CKTk37-I?si=Y4JjSrTsMe-KRmB2"><span style="font-family:Georgia, serif;">I Just Wanna Stop</span></a><span style="font-family:Georgia, serif;">" - The Jimmy Castor Bunch</span></li>\n    </ul>\n  </li>\n  <li><a href="https://youtu.be/tbmNuB7spmA?si=dyAy4Zbv7IK0Ybt-"><span style="font-family:Georgia, serif;"><strong>Graduation Day</strong></span></a>\n    <ul>\n      <li><span style="font-family:Georgia, serif;">"</span><a href="https://youtu.be/Spx4kmY67Wc?si=qqfPL7j1ytncoGH_"><span style="font-family:Georgia, serif;">Pomp and CircumstanceMarch No. 1</span></a><span style="font-family:Georgia, serif;">" - Edward Elgar</span></li>\n    </ul>\n  </li>\n  <li><a href="https://youtu.be/W0VnPiyXSRQ?si=sSbbKweCeTMJb707"><span style="font-family:Georgia, serif;"><strong>All Falls Down</strong></span></a>\n    <ul>\n      <li><span style="font-family:Georgia, serif;">"</span><a href="https://youtu.be/vuD1gRtGqx4?si=y1E5dy_rEVOzPjV0"><span style="font-family:Georgia, serif;">Mystery of Iniquity</span></a><span style="font-family:Georgia, serif;">" - Lauryn Hill</span></li>\n    </ul>\n  </li>\n  <li><span style="font-family:Georgia, serif;">I'll Fly Away</span></li>\n  <li><a href="https://youtu.be/mn77gzjBl1U?si=5u49oTaX71eoBCh3"><span style="font-family:Georgia, serif;"><strong>Spaceship</strong></span></a>\n    <ul>\n      <li><span style="font-family:Georgia, serif;">"</span><a href="https://youtu.be/KJoeTh00gjk?si=X-kYjYi9Fv0T3NyP"><span style="font-family:Georgia, serif;">Distant Lover</span></a><span style="font-family:Georgia, serif;">" - Marvin Gaye</span></li>\n    </ul>\n  </li>\n  <li><a href="https://youtu.be/MYF7H_fpc-g?si=JTLeJgLOobgq2Ke-"><span style="font-family:Georgia, serif;"><strong>Jesus Walks</strong></span></a>\n    <ul>\n      <li><span style="font-family:Georgia, serif;">"</span><a href="https://youtu.be/Q2MeSvUl_Ks?si=5XXzQ-TUXbA5AVm2"><span style="font-family:Georgia, serif;">Walk With Me</span></a><span style="font-family:Georgia, serif;">" - The ARC Choir</span></li>\n      <li><span style="font-family:Georgia, serif;">"</span><a href="https://youtu.be/x1xmXOP3lhM?si=jwv_myYSjb7NILj5"><span style="font-family:Georgia, serif;">(Don't Worry) If There's a Hell Below, We're All Going to Go</span></a><span style="font-family:Georgia, serif;">" - Curtis Mayfield</span></li>\n    </ul>\n  </li>\n  <li><a href="https://youtu.be/p4NvOKy7GOU?si=9uw9vbidoKiFBKQ-"><span style="font-family:Georgia, serif;"><strong>Never Let Me Down</strong></span></a>\n    <ul>\n      <li><span style="font-family:Georgia, serif;">"</span><a href="https://youtu.be/C71EfYUIrYo?si=uZjmVqS3uVnOGr7O"><span style="font-family:Georgia, serif;">Maybe It's the Power of Love</span></a><span style="font-family:Georgia, serif;">" - Blackjack</span></li>\n    </ul>\n  </li>\n  <li><span style="font-family:Georgia, serif;">Get Em High</span></li>\n  <li><span style="font-family:Georgi