5	heartbreak	839cea988fcb44c7b60eae02817970aecd31da97	04. 808s & Heartbreak		f	t	\N			<figure class="image"><img src="/808s_&amp;_heartbreak.png"></figure>\n<p><span class="text-big" style="font-family:Georgia, serif;"><strong>808s &amp; Heartbreak (2008)</strong></span></p>\n<p>Album ten rezygnuje z bogatego samplingu melodii na rzecz surowego brzmienia maszyny perkusyjnej Roland TR-808, budujac fundamenty pod nowoczesny trap i emocjonalny rap. Dominacja sampli perkusyjnych o glebokim basie zostala tu polaczona z warstwami syntezatorow i przetworzonym wokalem, a sampling melodyczny stal sie oszczedny i mocno przefiltrowany. Glowne zrodla inspiracji stanowily post-punk, nowa fala oraz plemienne rytmy afrykanskie.</p>\n<ol>\n  <li><span style="font-family:Georgia, serif;">Say You Will</span></li>\n  <li><span style="font-family:Georgia, serif;">Welcome To Heartbreak</span></li>\n  <li><span style="font-family:Georgia, serif;">Heartless</span></li>\n  <li><span style="font-family:Georgia, serif;">Amazing</span></li>\n  <li><span style="font-family:Georgia, serif;">Love Lockdown</span></li>\n  <li><span style="font-family:Georgia, serif;">Paranoid</span></li>\n  <li><a href="https://youtu.be/kVl__NgDAdw?si=0UEjXi96zF9moNBz"><span style="font-family:Georgia, serif;"><strong>RoboCop</strong></span></a>\n    <ul>\n      <li><span style="font-family:Georgia, serif;">"</span><a href="https://youtu.be/y4fcqHVkxqE?si=IpoI1t9JudWdfTC5"><span style="font-family:Georgia, serif;">Kissing in the Rain</span></a><span style="font-family:Georgia, serif;">" - Patrick Doyle</span></li>\n    </ul>\n  </li>\n  <li><span style="font-family:Georgia, serif;">Street Lights</span></li>\n  <li><a href="https://youtu.be/1BlH1JZBeXI?si=UjORCmrWJa5X9cUe"><span style="font-family:Georgia, serif;"><strong>Bad News</strong></span></a>\n    <ul>\n      <li><span style="font-family:Georgia, serif;">"</span><a href="https://youtu.be/hVEbzdN_7n0?si=ajnWZ0Lc0a7e3u3t"><span style="font-family:Georgia, ser