6	mbdtf	c3acc66674c823c630f21bc312959b696929f8d2	05. My Beautiful Dark Twisted Fantasy		f	t	\N			<figure class="image image_resized" style="width:26.04%;"><img src="/mbdtf.jpg"></figure>\n<p><span class="text-big" style="font-family:Georgia, serif;"><strong>My Beautiful Dark Twisted Fantasy (2010)</strong></span></p>\n<p>Album stanowi powrot do muzycznego maksymalizmu i jest uznawany za szczytowe osiagniecie Westa w dziedzinie skomplikowanego samplingu. Artysta porzucil minimalizm na rzecz gestych, wielowarstwowych kompozycji, w ktorych laczyl sample z rocka progresywnego, jazzu i folk-rocka z zywymi instrumentami oraz sekcjami smyczkowymi. Glowne zrodla inspiracji objely szerokie spektrum bialego rocka lat 70. oraz niszowych nagran soulowych.</p>\n<ol>\n  <li><a href="https://youtu.be/UTH1VNHLjng?si=HdFU03aeamlTGzei"><span style="font-family:Georgia, serif;"><strong>Dark Fantasy</strong></span></a>\n    <ul>\n      <li><span style="font-family:Georgia, serif;">"</span><a href="https://youtu.be/uVkvI3MPbvQ?si=1MLS-B9SHL-d4PjU"><span style="font-family:Georgia, serif;">In High Places</span></a><span style="font-family:Georgia, serif;">" - Mike Oldfield, Jon Anderson</span></li>\n    </ul>\n  </li>\n  <li><a href="https://youtu.be/miJAfs7jhak?si=_yDtGqNrjLv82QAr"><span style="font-family:Georgia, serif;"><strong>Gorgeous</strong></span></a>\n    <ul>\n      <li><span style="font-family:Georgia, serif;">"</span><a href="https://youtu.be/JIxJOO02jWo?si=u2DJcj9I9s19yZpy"><span style="font-family:Georgia, serif;">You Showed Me</span></a><span style="font-family:Georgia, serif;">" - The Turtles</span></li>\n    </ul>\n  </li>\n  <li><a href="https://youtu.be/chPDTUjnWgA?si=KITn0NMzh30mAZIH"><span style="font-family:Georgia, serif;"><strong>POWER</strong></span></a>\n    <ul>\n      <li><span style="font-family:Georgia, serif;">"</span><a href="https://youtu.be/cozD75RcSRM?si=E0uydkC8mh-FrJUm"><span style="font-family:Georgia, serif;">It's Your Thing</span></a><span style="